<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Document</title>
</head>
<body>
<script>
    function foo(m, array){
    let hash = {}
    for(let i = 0; i < array.length; i++){
        let index = m / parseInt(array[i])
        if(hash[index]){
            return 'yes'
        }else{
            hash[parseInt(array[i])] = 1
        }
    }
    return 'no'
}

</script>
</body>
</html>
